\viewkind4\uc1\pard\ltrpar\sa200\sl276\slmult1\tx6487\lang2057\f0\fs36 Crumpling a sheet of paper seems simple and doesn't require much effort, but explaining the behaviour of the crumpled ball is another matter entirely. Once scrunched, a paper ball is more than 75 percent air. Yet the fact that the ball is able to display extraordinary strength and resistance to further compression has confounded physicists. A report in the journal Physical Review Letters describes one aspect of the behaviour of crumpled sheets: the changes in size of crumpled sheets in relation to the force they withstand.\par
A crushed thin sheet is essentially a mass of conical points connected by curved ridges in which the energy is stored. During further compression of the sheet these ridges collapse and smaller ones form. The consequence is an increase of energy stored within the wad. Scientists at the University of Chicago modelled how the force required to compress the crumpled balls relates to their size. They compacted thin aluminized plastic foil and then placed it inside a cylinder equipped with a piston to crush the sheet. An unexpected finding was the continuous decrease of the height of the ball even three weeks after the researchers had applied the weight.\par
